def n_less_than_eight(nums):
    count = 0
    for num in nums:
        if num < 8:
            count += 1
    return count

def separate_ages(ages):
    less_than_eight = []
    more_than_eight = []
    for age in ages:
        if age < 8:
            less_than_eight.append(age)
        else:
            more_than_eight.append(age)
    return less_than_eight

